import Button from "../Button/Button";


interface FormProps {

    heading: string
    buttonText : string

}


const FormLogin: React.FC<FormProps> = ({heading,buttonText}) => {
    return (

        <section className="flex flex-col w-2/6 shadow-xl h-2/4 p-10 rounded">

            
            <h3 className="text-heading-blue-800  text-3xl font-bold">{heading}</h3>

            <form className="w-full my-5" action="#" method="POST">

                <div className="my-10">
                <input 
                className="p-5 w-full bg-slate-100 rounded-xl placeholder:text-lg"
                type="email"
                placeholder="Enter your email"
                />

                </div>

                <Button text = {buttonText} />

            </form>

            <hr />

            <a className="w-full text-center p-4 font-medium border border-black rounded-xl">
                Continue with Google 
            </a>

            



        </section>
        
    );
}

export default FormLogin;
